import React, { useState } from 'react';




const App=()=>{
const state = useState();

const [count,setCount]=useState(5);

setCount()

const InClick=()=>{
    
    console.log('clicked',count++);
};





return(
    <>
        <h1>{count}</h1>
        <button onClick={InClick}>Click Me</button>
    </>
)

}
export default App;
